All the devshell.toml schema options that are Declared in: the extra/ folder in the schema documentation are loaded on demand. In order to load an extra module, use the <name> in the import section. For example to make the locale options available, import locale: devshell.toml: imports = ["locale"] Make sure to add this at the first statement in the file. Now that the module has been loaded, the devshell.toml understands the locale prefix: imports = ["locale"] [locale]
lang = "en_US.UTF-8" From a nix flake you would import it like devshell.mkShell ({ extraModulesPath, ... }: { imports = ["${extraModulesPath}/locale.nix"];
