If IN_NIX_SHELL is nonempty, or DIRENV_IN_ENVRC is set to '1', then PRJ_ROOT is set to the value of PWD. This option specifies the path to use as the value of PRJ_ROOT in case IN_NIX_SHELL is empty or unset and DIRENV_IN_ENVRC is any value other than '1'. Set this to null to force PRJ_ROOT to be defined at runtime (except if IN_NIX_SHELL or DIRENV_IN_ENVRC are defined as described above). Otherwise, you can set this to a string representing the desired default path, or to a submodule of the same type valid in the 'env' options list (except that the 'name' field is ignored). Type : null or ((submodule) or non-empty string convertible to it) Default value : { eval = "$PWD";
} Example value : { # Use the top-level directory of the working tree eval = "$(git rev-parse --show-toplevel)";
}; Declared in : modules/devshell.nix

